import React from "react";
import style from './searchBar.module.css'
import { useState } from "react";

export default function SearchBar(props) {
  return (
    <div className={style.container}>
      <input className={style.input} type="search" placeholder="Ingrese el numero de personaje"/>
      <button className={style.boton} onClick={(props)=>props.onSearch(props)}>Agregar</button>
    </div>
  );
}

